(13, 'Berita 5', 'Kami juga memilih pembuatan selimut kaca karena selimut ini memiliki keunikan berupa paduan dari berbagai jenis dan corak kain, sehingga membuat desainnya menarik tidak seperti selimut biayanya hanya mempunyai satu motif atau desain. Dengan ini tentunya masyarakat akan menyukai sehingga produk ini mempunyai daya jual yang tinggi.', '2019-10-18', 'hoshi.png');

