INSERT INTO `tentang` (`id`, `tentang`) VALUES
(3, '<h1>Vission:</h1>\r\n<ul>\r\n<li>Menjadi perusahaan industri pengolahan sampah dan jasa konsultan bidang lingkungan hidup, energi, dan pertanian yang unggul dan terpercaya di Indonesia.</li>\r\n<li>Menjadikan produk pupuk organik cair, briket, dan batako mampu bersaing dengan produk lainnya di pasar Indonesia.</li>\r\n<li>Menjadi solusi permasalahan lingkungan hidup, energi, dan pertanian dengan menggunakan teknologi tepat guna dan ramah lingkungan di Indonesia.</li>\r\n</ul>\r\n<h1>Mission:</h1>\r\n<ul>\r\n<li>Menyediakan jasa konsultasi bidang lingkungan hidup, energi, dan pertanian untuk masyarakat industri dan pemangku kepentingan.</li>\r\n<li>Selalu mengedepankan inovasi dalam menjawab tuntutan zaman dan perkembangan teknologi.</li>\r\n<li>Membuat produk pupuk organik cair, briket, dan batako yang berkualitas dan bermutu sesuai dengan kebutuhan konsumen di Indonesia.</li>\r\n<li>Meningkatkan promosi produk melalui media online maupun offline agar penerapan teknologi tepat guna dan ramah lingkungan semakin masif di Indonesia.</li>\r\n</ul>\r\n<h1>Purpose</h1>\r\n<ul>\r\n<li>Mengolah sampah menjadi produk yang bernilai ekonomis sehingga mempunyai daya jual tinggi dan menjadi solusi dalam mengatasi permasalahan sampah di Kalimantan Barat.</li>\r\n<li>Mengatasi permasalahan lingkungan hidup, energi, dan pertanian dengan langkah penanganan yang solutif.</li>\r\n</ul>');

