INSERT INTO `uu` (`id`, `kategori`, `tgl_upload`, `file_name`, `file_size`, `file_type`, `tentang`) VALUES
(32, 'konstruksi', '2017-08-08', 'Konstruksi_UU_22017.pdf', 225466, 'pdf', 'Konstruksi merupakan suatu kegiatan membangun sarana maupun prasarana. Dalam sebuah bidang arsitektur atau teknik sipil, sebuah konstruksi juga dikenal sebagai bangunan atau satuan infrastruktur pada sebuah area atau pada beberapa area. Secara ringkas konstruksi didefinisikan sebagai objek keseluruhan bangun(an) yang terdiri dari bagian-bagian struktur. Misal, Konstruksi Struktur Bangunan adalah bentuk/bangun secara keseluruhan dari struktur bangunan. contoh lain: Konstruksi Jalan Raya, Konstruk'),
(33, 'Korporasi', '2017-09-13', 'Korporasi_UU_PT_402007-1.PDF', 371264, 'PDF', '<p>Korporasi adalah suatu gabungan orang yang dalam pergaulan hukum bertindak bersama-sama sebagai subjek hukum tersendiri sebagai suatu personifikasi. Korporasi adalah badan usaha yang keberadaannya dan status hukumnya disamakan dengan manusia (orang), tanpa melihat bentuk organisasinya.</p>'),
(34, 'Perbankan', '2017-08-08', 'Perbankan_dan_Finansial_UU_101998.pdf', 63280, 'pdf', 'Definisi Bank menurut Undang-Undang  RI Nomor 10 Tahun 1998 adalah badan usaha yang menghimpun dana dari masyarakat dalam bentuk simpanan dan menyalurkannya kepada masyarakat dalam bentuk kredit dan atau bentuk-bentuk lainnya dalam rangka meningkatkan taraf hidup rakyat banyak.'),
(35, 'Kepailitan', '2017-08-08', 'Kepailian_UU_37_2004.pdf', 334730, 'pdf', 'Pengertian dari bangkrut atau pailit menurut Ensiklopedia Ekonomi Keuangan Perdagangan antara lain, keadaan dimana seseorang yang oleh suatu pengadilan dinyatakan bankrupt dan yang aktivanya atau warisannya telah diperuntukkan untuk membayar utang-utangnya. Sedangkan, kepailitan menurut UU Kepailitan diartikan sebagai sita umum atas semua kekayaan Debitor Pailit yang pengurusan dan pemberesannya dilakukan oleh Kurator di bawah pengawasan Hakim Pengawas sebagaimana diatur dalam Undang-Undang.'),
(36, 'Investasi', '2017-09-14', 'Investasi_UU25Tahun2007PenanamanModal.pdf', 65651, 'pdf', '<p>Investasi adalah mengeluarkan sejumlah uang atau menyimpan uang pada sesuatu dengan harapan suatu saat mendapat keuntungan financial. Contoh investasi adalah pembelian berupa asset financial seperti obligasi, saham , asuransi. Dapat juga pembelian berupa barang seperti mobil atau property seperti rumah atau tanah.</p>'),
(37, 'Perdagangan', '2017-08-08', 'Hukum_Perdagangan_UU_7_tahun_2014.pdf', 196464, 'pdf', 'Hukum dagang ialah aturan-aturan hukum yang mengatur hubungan orang yang satu dengan yang lainnya, khusunya dalam perniagaan. Hukum dagang adalah hukum perdata khusus. Pada mulanya kaidah hukum yang kita kenal sebagi hukum dagang saat ini mulai muncul dikalangan kaum pedagang sekitar abad ke-17. Kaidah-kaidah hukum tersebut sebenarnya merupakan kebiasaan diantara mereka yang muncul dalam pergaulan di bidang perdagangan.'),
(38, 'Tenaga', '2017-08-08', 'Ketenagakerjaan_UU_132003.pdf', 180861, 'pdf', 'Ketenagakerjaan adalah segala hal yang berhubungan dengan tenaga kerja pada waktu sebelum, selama, dan sesudah masa kerja. Untuk mempermudah memahami tentang konsep klasifikasi ketenagakerjaan, perhatikan keterangan berikut ini.');

